import React from "react";
import {
  Card,
  CardContent,
  CardMedia,
  CardHeader,
  Typography,
  withStyles,
  Button
} from "@material-ui/core";
import { orange } from "@material-ui/core/colors";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    height: 250,
    width: 175,
    display: "relative"
  },
  media: {
    height: 90,
    width: 175,
    backgroundSize: "contain",
    backgroundRepeat: "no-repeat",
    opacity: 0.5,
    margin: "5px 0"
  },
  content: {
    height: 150,
    width: 175,
    padding: 0
  },
  header: {
    paddingTop: 5,
    paddingBottom: 5
  },
  ratingsContainer: {
    display: "flex",
    justifyContent: "center",
    margin: "10px auto"
  },
  rating: {
    padding: "0 5px",
    borderTop: "1px solid grey",
    borderBottom: "1px solid grey",
    borderLeft: "1px solid grey",
    width: 35
  },
  rating4: {
    padding: "0 5px",
    borderTop: "1px solid grey",
    borderBottom: "1px solid grey",
    borderLeft: "1px solid grey",
    borderRight: "1px solid grey",
    width: 35
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card raised className={classes.card}>
      <CardMedia
        title="DiscMania Logo"
        image={discMania}
        className={classes.media}
      />

      <CardContent className={classes.content}>
        <CardHeader
          title={props.data.discName}
          subheader={props.data.discType}
          className={classes.header}
        />
        <div className={classes.ratingsContainer}>
          <Typography variant="h6" align="center" className={classes.rating}>
            {props.data.infiniteRatings.speed}
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            {props.data.infiniteRatings.glide}
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            {props.data.infiniteRatings.turn}
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating4}>
            {props.data.infiniteRatings.fade}
          </Typography>
        </div>
        <Button
          size="small"
          to={props.data.link}
          style={{ marginLeft: 10, color: orange[400] }}
        >
          Learn More
        </Button>
      </CardContent>
    </Card>
  );
});
